import React from 'react';

import styles from './Input.module.css';

const Input = (props) => {
  return (
    <div className={styles.Input}>
      <label>{props.label}</label>
      <select value={props.value} onChange={props.change}>
        {props.options.map(option => (
          <option
            value={option.value}
            key={option.value} >
            {option.displayValue}
          </option>
        ))}
      </select>
    </div>
  );
}

export default Input;
